/// Error code enum
enum ErrorCode {
  NO_ERROR(0),
  OUT_OF_MEMORY(1),
  NOT_SUPPORT(2),
  COMPUTE_SIZE_ERROR(3),
  NO_EXECUTION(4),
  INVALID_VALUE(5),

  /// User error
  INPUT_DATA_ERROR(10),
  CALL_BACK_STOP(11),

  /// Op Resize Error
  TENSOR_NOT_SUPPORT(20),
  TENSOR_NEED_DIVIDE(21),

  /// File error
  FILE_CREATE_FAILED(30),
  FILE_REMOVE_FAILED(31),
  FILE_OPEN_FAILED(32),
  FILE_CLOSE_FAILED(33),
  FILE_RESIZE_FAILED(34),
  FILE_SEEK_FAILED(35),
  FILE_NOT_EXIST(36),
  FILE_UNMAP_FAILED(37),

  /// custom
  BOOL_TRUE(100),
  BOOL_FALSE(101),
  UNKNOWN_ERROR(102),
  MNN_INVALID_PTR(103);

  final int value;
  const ErrorCode(this.value);

  static ErrorCode fromValue(int value) => switch (value) {
        0 => NO_ERROR,
        1 => OUT_OF_MEMORY,
        2 => NOT_SUPPORT,
        3 => COMPUTE_SIZE_ERROR,
        4 => NO_EXECUTION,
        5 => INVALID_VALUE,
        10 => INPUT_DATA_ERROR,
        11 => CALL_BACK_STOP,
        20 => TENSOR_NOT_SUPPORT,
        21 => TENSOR_NEED_DIVIDE,
        30 => FILE_CREATE_FAILED,
        31 => FILE_REMOVE_FAILED,
        32 => FILE_OPEN_FAILED,
        33 => FILE_CLOSE_FAILED,
        34 => FILE_RESIZE_FAILED,
        35 => FILE_SEEK_FAILED,
        36 => FILE_NOT_EXIST,
        37 => FILE_UNMAP_FAILED,
        100 => BOOL_TRUE,
        101 => BOOL_FALSE,
        102 => UNKNOWN_ERROR,
        103 => MNN_INVALID_PTR,
        _ => throw ArgumentError('Unknown value for ErrorCode: $value'),
      };
}

